import React from "react";
import {add, sub, mult, div} from "./Calc";
function Aapp() {
    return(
        <>
   <ul>
     <li>{add(10,5)}</li>
     <li>{sub(10,5)}</li>
     <li>{mult(10,5)}</li>
     <li>{div(10,3)}</li>
   </ul>
   </>
    );
    
}
export default Aapp;
